import React from 'react'
import NavigationBar from './components/Sidebar.jsx';
import { Image, Grid } from 'semantic-ui-react';
import cover from './static/cover.png';

function App() {
  return (
    <div className="AppDiv">
      <Grid celled='internally'>
        <Grid.Row>
            <Grid.Column width={1}>
              <NavigationBar />
            </Grid.Column>
            <Grid.Column width={15}>
              <Image src = {cover} size = 'medium'/>
            </Grid.Column>
          </Grid.Row>
        </Grid>

    </div>
  );
};

export default App;
